    <br />
    <br />
    <br />
    <br />

    <h2>About Lumin</h2>
    <p>
        Lumin is a social media platform that I designed for the sake of showing
        my web development skills to potential employers. My goal was to show that
        I can use a variety of tools as well as engineer my own solutions and
        organize a semi-large scale application. I consider the weakest area to
        be the styling. Although style is almost just as important as functionality,
        my strengths lie in the functional side of things and so that is what I
        wanted to show off.
    </p>

    <h3>Notable Features</h3>
    <ul>
        <li>Single-page web app (outside of the login and create account pages)</li>
        <li>Uploading pictures</li>
        <li>Creating posts</li>
        <li>Liking posts</li>
        <li>Commenting on posts</li>
        <li>Editing post captions, comments, and your bio</li>
        <li>Deleting anything that you can create</li>
        <li>Sea");
            WriteLiteral(@"rching for and adding friends</li>
        <li>Custome right-click context menus</li>
        <li>Personal profile viewer</li>
        <li>Personal bio paragraph</li>
        <li>Fullscreen image viewer</li>
        <li>Lazy loading for posts, images, and comments</li>
        <li>Help menu</li>
        <li>Front-end and back-end validation</li>
        <li>
            Most importantly, I took an object oriented approach. To show that the
            content is dynamic, changes happen in real time. If an image that is
            used in a post is deleted, the post is also deleted, as well as it's
            likes and comments, and the likes of those comments. Not only are they
            deleted from the database, but they are removed from anywhere they
            appear on the page in real time.
        </li>
    </ul>

    <h3>Technologies and Tools</h3>
    <ul>
        <li>ASP.Net MVC Core</li>
        <li>Identity</li>
        <li>Entitiy Framework</li>
        <li>Bootstrap</");
            WriteLiteral(@"li>
        <li>Font Awesome</li>
        <li>JQuery</li>
        <li>HTML Sanitizer</li>
    </ul>

    <h3>Pitfalls</h3>
    <p>
        While developing Lumin, I realized my biggest weakness in programming;
        following my own rules. In school, my professors expected certain
        standards and so it was clear to me which formatting style to use and
        how to organize. However, being in the wild showed me that I am
        indecisive when it comes to my own conventions. Looking back, too much
        time was spent on petty reformatting and overengineering. So, full
        disclosure to employers, I work best within the confines of 
        predetermined conventions and styles, and in narrow scopes of code.
    </p>
    <p>
        These are features that are standard to social media that I either did not
        plan on implementing or scrapped due to time constraints.
    </p>
    <ul>
        <li>Direct messaging</li>
        <li>Notifications</li>
        <li>Sharin");
            WriteLiteral("g videos or gifs</li>\r\n        <li>Privacy options</li>\r\n        <li>Mobile friendly display</li>\r\n    </ul>\r\n\r\n    <h3>About Me</h3>\r\n    ");
            EndContext();
