    <h4>Jacob Landis</h4>
    <p>
        I am a Web &amp; Software Development graduate from Western Technical College.
        Born and raised in rural Wisconsin, I enjoy doing anything that let's me enjoy
        the splendor of the driftless region. Despite my love for nature I am also
        drawn to programming. From my childhood days of using free online programming
        tools like Scratch at the local library when we couldn't afford a computer or
        internet, to building contraptions in games, to my college career where I
